<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta
      name="viewport"
      content="width=device-width,user-scalable=no,initial-scale=1.0, minimum-scale=1.0,maximum-scale=1.0"
    />
    <title>Gamining</title>
    <style>
      @charset "UTF-8";
      article,
      aside,
      details,
      figcaption,
      figure,
      footer,
      header,
      hgroup,
      menu,
      nav,
      section {
        display: block;
      }
      html,
      body,
      div,
      span,
      applet,
      object,
      iframe,
      h1,
      h2,
      h3,
      h4,
      h5,
      h6,
      p,
      blockquote,
      pre,
      a,
      abbr,
      acronym,
      address,
      big,
      cite,
      code,
      del,
      dfn,
      em,
      img,
      ins,
      kbd,
      q,
      s,
      samp,
      small,
      strike,
      strong,
      sub,
      sup,
      tt,
      var,
      b,
      u,
      i,
      center,
      dl,
      dt,
      dd,
      ol,
      ul,
      li,
      fieldset,
      form,
      label,
      legend,
      table,
      caption,
      tbody,
      tfoot,
      thead,
      tr,
      th,
      td,
      article,
      aside,
      canvas,
      details,
      embed,
      figure,
      figcaption,
      footer,
      header,
      hgroup,
      menu,
      nav,
      output,
      ruby,
      section,
      summary,
      time,
      mark,
      audio,
      video,
      button {
        margin: 0;
        padding: 0;
        border: 0;
        font-size: 100%;
        font: inherit;
        vertical-align: baseline;
        box-sizing: border-box;
        color: #fff;
        font-family: Montserrat;
      }
      img,
      svg {
        transition: 0.3s;
      }
      a:hover,
      button:hover {
        cursor: pointer;
        opacity: 0.7;
      }
      .dnone {
        display: none;
      }
      a {
        text-decoration: none;
      }
      input {
        box-sizing: border-box;
      }
      .free_img {
        position: relative;
        height: 0px;
        width: 0px;
        display: flex;
        justify-content: center;
        align-items: center;
      }
      body,
      html {
        overflow: hidden;
      }
      .app {
        display: flex;
        justify-content: center;
        align-items: center;
        width: 100dvw;
        height: 100dvh;
        position: absolute;
      }
      .content_wrapper {
        display: flex;
        justify-content: center;
        align-items: center;
        width: 100dvw;
      }
      .free_img {
        width: 0;
        height: 0;
        display: flex;
        justify-content: center;
        align-items: center;
        position: relative;
      }
      .bg {
        position: absolute;
        top: 0;
        left: 0;
      }
      .bg img {
        width: 100dvw;
        height: 100dvh;
      }
      .bg .bgHor {
        display: none;
      }
      .bg .bgVert {
        display: block;
      }
      .fone {
        overflow: hidden;
      }
      .fone img {
        position: absolute;
        z-index: 1;
      }
      .content {
        display: flex;
        justify-content: center;
        align-items: center;
        align-content: center;
        flex-wrap: wrap;
        height: 100dvh;
        width: 100dvw;
      }
      .content .nft {
        z-index: 2;
      }
      .content .nft img {
        transition: transform 0.5s;
      }
      .content .nft img.hide {
        transform: scale(0) rotate(-820deg);
      }
      .content .text {
        overflow: hidden;
        z-index: 2;
      }
      .content .text img {
        transition: transform 0.5s;
        position: absolute;
      }
      .content .text img.hide {
        transform: translate(0);
      }
      .content .btn {
        z-index: 2;
      }
      .content .btn img {
        transition: opacity 0.5s;
      }
      .content .btn img.hide {
        opacity: 0;
      }
      @media (min-aspect-ratio: 1/1) {
        .fone .decorCoin1 {
          height: 15dvh;
          bottom: 5dvh;
          left: 44dvw;
        }
        .fone .decorCoin2 {
          height: 20dvh;
          right: 0;
        }
        .spinner {
          display: none;
        }
        .content__spinner-hor {
          width: 48dvw;
          height: 100dvh;
          display: flex;
          justify-content: center;
          align-items: center;
        }
        .content__spinner-hor #speenStormHor {
          width: auto;
          height: 90dvh;
        }
        .content__spinner-hor #speenBgHor {
          width: auto;
          height: 80.5dvh;
        }
        .content__spinner-hor #spennerHor {
          width: auto;
          height: 45dvh;
        }
        .content__spinner-hor #speenDecorHor {
          width: auto;
          height: 54.4dvh;
        }
        .content {
          width: 48dvw;
        }
        .bg .bgVert {
          display: none;
        }
        .bg .bgHor {
          display: block;
        }
        .logo {
          height: 12dvh;
        }
        .logo #logo {
          width: auto;
          height: 7dvh;
        }
        .text {
          height: 10vh;
        }
        .text img {
          width: auto;
          height: 9dvh;
        }
        .nft {
          height: 50dvh;
        }
        .nft img {
          width: auto;
          height: 50dvh;
        }
        .nft img.big {
          height: 74dvh;
        }
        .btn {
          height: 13dvh;
        }
        .btn img {
          width: auto;
          height: 11dvh;
        }
        .btn img.big {
          height: 24dvh;
        }
      }
      @media (max-aspect-ratio: 1/1) {
        .fone .decorCoin1 {
          height: 15dvh;
          bottom: 7dvh;
          left: 5dvw;
        }
        .fone .decorCoin2 {
          height: 17dvh;
          right: 0;
          bottom: 22dvh;
        }
        .content__spinner-hor {
          display: none;
        }
        .logo {
          height: 5dvh;
        }
        .logo #logo {
          width: auto;
          height: 5dvh;
        }
        .spinner {
          display: flex;
          height: 48dvh;
        }
        .spinner #speenStormVert {
          width: auto;
          height: 55dvh;
        }
        .spinner #spennerVert {
          width: auto;
          height: 28dvh;
        }
        .spinner #speenBgVert {
          width: auto;
          height: 50.5dvh;
        }
        .spinner #speenDecorVert {
          width: auto;
          height: 34.5dvh;
        }
        .text {
          height: 6vh;
        }
        .text img {
          width: auto;
          height: 6dvh;
        }
        .nft {
          height: 28dvh;
        }
        .nft img {
          width: auto;
          height: 25dvh;
        }
        .nft img.big {
          width: auto;
          height: 39dvh;
        }
        .btn {
          height: 7dvh;
        }
        .btn img {
          width: auto;
          height: 7dvh;
        }
        .btn img.big {
          width: auto;
          height: 14dvh;
        }
      }
      .blink {
        animation: blink 1s ease-in-out infinite alternate forwards;
      }
      @keyframes blink {
        0% {
          transform: scale(1);
        }
        to {
          transform: scale(1.1);
        }
      }
      .levitation {
        animation: levitation 4s ease-in-out infinite alternate forwards;
      }
      .levitation2 {
        animation: levitation2 5s ease-in-out infinite alternate forwards;
      }
      @keyframes levitation {
        0% {
          transform: scale(1) translate(0) rotate(0);
        }
        to {
          transform: scale(0.9) translate(-20%, -120%) rotate(-50deg);
        }
      }
      @keyframes levitation2 {
        0% {
          transform: scale(1) translate(0) rotate(0);
        }
        to {
          transform: scale(0.9) translate(30%, 80%) rotate(150deg);
        }
      }
      .stormRotate {
        transition: transform 0.3s;
        animation: stormRotate 4s ease-in-out infinite alternate forwards;
      }
      @keyframes stormRotate {
        0% {
          transform: rotate(0);
        }
        to {
          transform: rotate(-25deg);
        }
      }
    </style>
  </head>

          broadcastEvent(
            EVENTS.INFO,
            'Set isViewable to ' + stringify(isViewable)
          );
          broadcastEvent(EVENTS.VIEWABLECHANGE, isViewable);
        };

        bridge.setSupports = function (
          sms,
          tel,
          calendar,
          storePicture,
          inlineVideo
        ) {
          supportProperties = {
            sms: sms,
            tel: tel,
            calendar: calendar,
            storePicture: storePicture,
            inlineVideo: inlineVideo,
          };
        };

        bridge.notifyReadyEvent = function () {
          this.nativeSDKFiredReady = true;
          broadcastEvent(EVENTS.READY);
        };

        bridge.notifyErrorEvent = function (message, action) {
          broadcastEvent(EVENTS.ERROR, message, action);
        };

        // Temporary aliases while we migrate to the new API
        bridge.fireReadyEvent = bridge.notifyReadyEvent;
        bridge.fireErrorEvent = bridge.notifyErrorEvent;

        bridge.notifySizeChangeEvent = function (width, height) {
          if (
            this.lastSizeChangeProperties &&
            width == this.lastSizeChangeProperties.width &&
            height == this.lastSizeChangeProperties.height
          ) {
            return;
          }

          this.lastSizeChangeProperties = {
            width: width,
            height: height,
          };
          broadcastEvent(EVENTS.SIZECHANGE, width, height);
        };

        bridge.notifyStateChangeEvent = function () {
          if (state === STATES.LOADING) {
            broadcastEvent(EVENTS.INFO, 'Native SDK initialized.');
          }

          broadcastEvent(EVENTS.INFO, 'Set state to ' + stringify(state));
          broadcastEvent(EVENTS.STATECHANGE, state);
        };

        bridge.notifyViewableChangeEvent = function () {
          broadcastEvent(
            EVENTS.INFO,
            'Set isViewable to ' + stringify(isViewable)
          );
          broadcastEvent(EVENTS.VIEWABLECHANGE, isViewable);
        };

        // Constants. ////////////////////////////////////////////////////////////////////////////////////

        var VERSION = (mraid.VERSION = '2.0');

        var STATES = (mraid.STATES = {
          LOADING: 'loading',
          DEFAULT: 'default',
          EXPANDED: 'expanded',
          HIDDEN: 'hidden',
          RESIZED: 'resized',
        });

        var EVENTS = (mraid.EVENTS = {
          ERROR: 'error',
          INFO: 'info',
          READY: 'ready',
          STATECHANGE: 'stateChange',
          VIEWABLECHANGE: 'viewableChange',
          SIZECHANGE: 'sizeChange',
        });

        var PLACEMENT_TYPES = (mraid.PLACEMENT_TYPES = {
          UNKNOWN: 'unknown',
          INLINE: 'inline',
          INTERSTITIAL: 'interstitial',
        });

        // External MRAID state: may be directly or indirectly modified by the ad JS. ////////////////////

        // Properties which define the behavior of an expandable ad.
        var expandProperties = {
          width: false,
          height: false,
          useCustomClose: false,
          isModal: true,
        };

        var resizeProperties = {
          width: false,
          height: false,
          offsetX: false,
          offsetY: false,
          customClosePosition: 'top-right',
          allowOffscreen: true,
        };

        var orientationProperties = {
          allowOrientationChange: true,
          forceOrientation: 'none',
        };

        var supportProperties = {
          sms: false,
          tel: false,
          calendar: false,
          storePicture: false,
          inlineVideo: false,
        };

        // default is undefined so that notifySizeChangeEvent can track changes
        var lastSizeChangeProperties;

        var maxSize = {};

        var currentPosition = {};

        var defaultPosition = {};

        var screenSize = {};

        var hasSetCustomClose = false;

        var listeners = {};

        // Internal MRAID state. Modified by the native SDK. /////////////////////////////////////////////

        var state = STATES.LOADING;

        var isViewable = false;

        var placementType = PLACEMENT_TYPES.UNKNOWN;

        //////////////////////////////////////////////////////////////////////////////////////////////////

        var EventListeners = function (event) {
          this.event = event;
          this.count = 0;
          var listeners = {};

          this.add = function (func) {
            var id = String(func);
            if (!listeners[id]) {
              listeners[id] = func;
              this.count++;
            }
          };

          this.remove = function (func) {
            var id = String(func);
            if (listeners[id]) {
              listeners[id] = null;
              delete listeners[id];
              this.count--;
              return true;
            } else {
              return false;
            }
          };

          this.removeAll = function () {
            for (var id in listeners) {
              if (listeners.hasOwnProperty(id)) this.remove(listeners[id]);
            }
          };

          this.broadcast = function (args) {
            for (var id in listeners) {
              if (listeners.hasOwnProperty(id))
                listeners[id].apply(mraid, args);
            }
          };

          this.toString = function () {
            var out = [event, ':'];
            for (var id in listeners) {
              if (listeners.hasOwnProperty(id)) out.push('|', id, '|');
            }
            return out.join('');
          };
        };

        var broadcastEvent = function () {
          var args = new Array(arguments.length);
          var l = arguments.length;
          for (var i = 0; i < l; i++) args[i] = arguments[i];
          var event = args.shift();
          if (listeners[event]) listeners[event].broadcast(args);
        };

        var contains = function (value, array) {
          for (var i in array) {
            if (array[i] === value) return true;
          }
          return false;
        };

        var clone = function (obj) {
          if (obj === null) return null;
          var f = function () {};
          f.prototype = obj;
          return new f();
        };

        var stringify = function (obj) {
          if (typeof obj === 'object') {
            var out = [];
            if (obj.push) {
              // Array.
              for (var p in obj) out.push(obj[p]);
              return '[' + out.join(',') + ']';
            } else {
              // Other object.
              for (var p in obj) out.push("'" + p + "': " + obj[p]);
              return '{' + out.join(',') + '}';
            }
          } else return String(obj);
        };

        var trim = function (str) {
          return str.replace(/^\s+|\s+$/g, '');
        };

        // Functions that will be invoked by the native SDK whenever a "change" event occurs.
        var changeHandlers = {
          state: function (val) {
            if (state === STATES.LOADING) {
              broadcastEvent(EVENTS.INFO, 'Native SDK initialized.');
            }
            state = val;
            broadcastEvent(EVENTS.INFO, 'Set state to ' + stringify(val));
            broadcastEvent(EVENTS.STATECHANGE, state);
          },

          viewable: function (val) {
            isViewable = val;
            broadcastEvent(EVENTS.INFO, 'Set isViewable to ' + stringify(val));
            broadcastEvent(EVENTS.VIEWABLECHANGE, isViewable);
          },

          placementType: function (val) {
            broadcastEvent(
              EVENTS.INFO,
              'Set placementType to ' + stringify(val)
            );
            placementType = val;
          },

          sizeChange: function (val) {
            broadcastEvent(EVENTS.INFO, 'Set screenSize to ' + stringify(val));
            for (var key in val) {
              if (val.hasOwnProperty(key)) screenSize[key] = val[key];
            }
          },

          supports: function (val) {
            broadcastEvent(EVENTS.INFO, 'Set supports to ' + stringify(val));
            supportProperties = val;
          },
        };

        var validate = function (obj, validators, action, merge) {
          if (!merge) {
            // Check to see if any required properties are missing.
            if (obj === null) {
              broadcastEvent(
                EVENTS.ERROR,
                'Required object not provided.',
                action
              );
              return false;
            } else {
              for (var i in validators) {
                if (validators.hasOwnProperty(i) && obj[i] === undefined) {
                  broadcastEvent(
                    EVENTS.ERROR,
                    'Object is missing required property: ' + i,
                    action
                  );
                  return false;
                }
              }
            }
          }

          for (var prop in obj) {
            var validator = validators[prop];
            var value = obj[prop];
            if (validator && !validator(value)) {
              // Failed validation.
              broadcastEvent(
                EVENTS.ERROR,
                'Value of property ' + prop + ' is invalid: ' + value,
                action
              );
              return false;
            }
          }
          return true;
        };

        var expandPropertyValidators = {
          useCustomClose: function (v) {
            return typeof v === 'boolean';
          },
        };

        //////////////////////////////////////////////////////////////////////////////////////////////////

        mraid.addEventListener = function (event, listener) {
          if (!event || !listener) {
            broadcastEvent(
              EVENTS.ERROR,
              'Both event and listener are required.',
              'addEventListener'
            );
          } else if (!contains(event, EVENTS)) {
            broadcastEvent(
              EVENTS.ERROR,
              'Unknown MRAID event: ' + event,
              'addEventListener'
            );
          } else {
            if (!listeners[event]) {
              listeners[event] = new EventListeners(event);
            }
            listeners[event].add(listener);
          }
        };

        mraid.close = function () {
          if (state === STATES.HIDDEN) {
            broadcastEvent(
              EVENTS.ERROR,
              'Ad cannot be closed when it is already hidden.',
              'close'
            );
          } else bridge.executeNativeCall(['close']);
        };

        mraid.expand = function (URL) {
          if (
            !(
              this.getState() === STATES.DEFAULT ||
              this.getState() === STATES.RESIZED
            )
          ) {
            broadcastEvent(
              EVENTS.ERROR,
              'Ad can only be expanded from the default or resized state.',
              'expand'
            );
          } else {
            var args = [
              'expand',
              'shouldUseCustomClose',
              expandProperties.useCustomClose,
            ];

            if (URL) {
              args = args.concat(['url', URL]);
            }

            bridge.executeNativeCall(args);
          }
        };

        mraid.getExpandProperties = function () {
          var properties = {
            width: expandProperties.width,
            height: expandProperties.height,
            useCustomClose: expandProperties.useCustomClose,
            isModal: expandProperties.isModal,
          };
          return properties;
        };

        mraid.getCurrentPosition = function () {
          return {
            x: currentPosition.x,
            y: currentPosition.y,
            width: currentPosition.width,
            height: currentPosition.height,
          };
        };

        mraid.getDefaultPosition = function () {
          return {
            x: defaultPosition.x,
            y: defaultPosition.y,
            width: defaultPosition.width,
            height: defaultPosition.height,
          };
        };

        mraid.getMaxSize = function () {
          return {
            width: maxSize.width,
            height: maxSize.height,
          };
        };

        mraid.getPlacementType = function () {
          return placementType;
        };

        mraid.getScreenSize = function () {
          return {
            width: screenSize.width,
            height: screenSize.height,
          };
        };

        mraid.getState = function () {
          return state;
        };

        mraid.isViewable = function () {
          return isViewable;
        };

        mraid.getVersion = function () {
          return mraid.VERSION;
        };

        mraid.open = function (URL) {
          if (!URL) broadcastEvent(EVENTS.ERROR, 'URL is required.', 'open');
          else bridge.executeNativeCall(['open', 'url', URL]);
        };

        mraid.removeEventListener = function (event, listener) {
          if (!event) {
            broadcastEvent(
              EVENTS.ERROR,
              'Event is required.',
              'removeEventListener'
            );
            return;
          }

          if (listener) {
            // If we have a valid event, we'll try to remove the listener from it.
            var success = false;
            if (listeners[event]) {
              success = listeners[event].remove(listener);
            }

            // If we didn't have a valid event or couldn't remove the listener from the event, broadcast an error and return early.
            if (!success) {
              broadcastEvent(
                EVENTS.ERROR,
                'Listener not currently registered for event.',
                'removeEventListener'
              );
              return;
            }
          } else if (!listener && listeners[event]) {
            listeners[event].removeAll();
          }

          if (listeners[event] && listeners[event].count === 0) {
            listeners[event] = null;
            delete listeners[event];
          }
        };

        mraid.setExpandProperties = function (properties) {
          if (
            validate(
              properties,
              expandPropertyValidators,
              'setExpandProperties',
              true
            )
          ) {
            if (properties.hasOwnProperty('useCustomClose')) {
              expandProperties.useCustomClose = properties.useCustomClose;
            }
          }
        };

        mraid.useCustomClose = function (shouldUseCustomClose) {
          expandProperties.useCustomClose = shouldUseCustomClose;
          hasSetCustomClose = true;
          bridge.executeNativeCall([
            'usecustomclose',
            'shouldUseCustomClose',
            shouldUseCustomClose,
          ]);
        };

        // MRAID 2.0 APIs ////////////////////////////////////////////////////////////////////////////////

        mraid.createCalendarEvent = function (parameters) {
          CalendarEventParser.initialize(parameters);
          if (CalendarEventParser.parse()) {
            bridge.executeNativeCall(CalendarEventParser.arguments);
          } else {
            broadcastEvent(
              EVENTS.ERROR,
              CalendarEventParser.errors[0],
              'createCalendarEvent'
            );
          }
        };

        mraid.supports = function (feature) {
          return supportProperties[feature];
        };

        mraid.playVideo = function (uri) {
          if (!mraid.isViewable()) {
            broadcastEvent(
              EVENTS.ERROR,
              'playVideo cannot be called until the ad is viewable',
              'playVideo'
            );
            return;
          }

          if (!uri) {
            broadcastEvent(
              EVENTS.ERROR,
              'playVideo must be called with a valid URI',
              'playVideo'
            );
          } else {
            bridge.executeNativeCall(['playVideo', 'uri', uri]);
          }
        };

        mraid.storePicture = function (uri) {
          if (!mraid.isViewable()) {
            broadcastEvent(
              EVENTS.ERROR,
              'storePicture cannot be called until the ad is viewable',
              'storePicture'
            );
            return;
          }

          if (!uri) {
            broadcastEvent(
              EVENTS.ERROR,
              'storePicture must be called with a valid URI',
              'storePicture'
            );
          } else {
            bridge.executeNativeCall(['storePicture', 'uri', uri]);
          }
        };

        var resizePropertyValidators = {
          width: function (v) {
            return !isNaN(v) && v > 0;
          },
          height: function (v) {
            return !isNaN(v) && v > 0;
          },
          offsetX: function (v) {
            return !isNaN(v);
          },
          offsetY: function (v) {
            return !isNaN(v);
          },
          customClosePosition: function (v) {
            return (
              typeof v === 'string' &&
              [
                'top-right',
                'bottom-right',
                'top-left',
                'bottom-left',
                'center',
                'top-center',
                'bottom-center',
              ].indexOf(v) > -1
            );
          },
          allowOffscreen: function (v) {
            return typeof v === 'boolean';
          },
        };

        mraid.setOrientationProperties = function (properties) {
          if (properties.hasOwnProperty('allowOrientationChange')) {
            orientationProperties.allowOrientationChange =
              properties.allowOrientationChange;
          }

          if (properties.hasOwnProperty('forceOrientation')) {
            orientationProperties.forceOrientation =
              properties.forceOrientation;
          }

          var args = [
            'setOrientationProperties',
            'allowOrientationChange',
            orientationProperties.allowOrientationChange,
            'forceOrientation',
            orientationProperties.forceOrientation,
          ];
          bridge.executeNativeCall(args);
        };

        mraid.getOrientationProperties = function () {
          return {
            allowOrientationChange:
              orientationProperties.allowOrientationChange,
            forceOrientation: orientationProperties.forceOrientation,
          };
        };

        mraid.resize = function () {
          if (
            !(
              this.getState() === STATES.DEFAULT ||
              this.getState() === STATES.RESIZED
            )
          ) {
            broadcastEvent(
              EVENTS.ERROR,
              'Ad can only be resized from the default or resized state.',
              'resize'
            );
          } else if (!resizeProperties.width || !resizeProperties.height) {
            broadcastEvent(
              EVENTS.ERROR,
              'Must set resize properties before calling resize()',
              'resize'
            );
          } else {
            var args = [
              'resize',
              'width',
              resizeProperties.width,
              'height',
              resizeProperties.height,
              'offsetX',
              resizeProperties.offsetX || 0,
              'offsetY',
              resizeProperties.offsetY || 0,
              'customClosePosition',
              resizeProperties.customClosePosition,
              'allowOffscreen',
              !!resizeProperties.allowOffscreen,
            ];

            bridge.executeNativeCall(args);
          }
        };

        mraid.getResizeProperties = function () {
          var properties = {
            width: resizeProperties.width,
            height: resizeProperties.height,
            offsetX: resizeProperties.offsetX,
            offsetY: resizeProperties.offsetY,
            customClosePosition: resizeProperties.customClosePosition,
            allowOffscreen: resizeProperties.allowOffscreen,
          };
          return properties;
        };

        mraid.setResizeProperties = function (properties) {
          if (
            validate(
              properties,
              resizePropertyValidators,
              'setResizeProperties',
              true
            )
          ) {
            var desiredProperties = [
              'width',
              'height',
              'offsetX',
              'offsetY',
              'customClosePosition',
              'allowOffscreen',
            ];

            var length = desiredProperties.length;

            for (var i = 0; i < length; i++) {
              var propname = desiredProperties[i];
              if (properties.hasOwnProperty(propname)) {
                resizeProperties[propname] = properties[propname];
              }
            }
          }
        };

        var CalendarEventParser = {
          initialize: function (parameters) {
            this.parameters = parameters;
            this.errors = [];
            this.arguments = ['createCalendarEvent'];
          },

          parse: function () {
            if (!this.parameters) {
              this.errors.push(
                'The object passed to createCalendarEvent cannot be null.'
              );
            } else {
              this.parseDescription();
              this.parseLocation();
              this.parseSummary();
              this.parseStartAndEndDates();
              this.parseReminder();
              this.parseRecurrence();
              this.parseTransparency();
            }

            var errorCount = this.errors.length;
            if (errorCount) {
              this.arguments.length = 0;
            }

            return errorCount === 0;
          },

          parseDescription: function () {
            this._processStringValue('description');
          },

          parseLocation: function () {
            this._processStringValue('location');
          },

          parseSummary: function () {
            this._processStringValue('summary');
          },

          parseStartAndEndDates: function () {
            this._processDateValue('start');
            this._processDateValue('end');
          },

          parseReminder: function () {
            var reminder = this._getParameter('reminder');
            if (!reminder) {
              return;
            }

            if (reminder < 0) {
              this.arguments.push('relativeReminder');
              this.arguments.push(parseInt(reminder) / 1000);
            } else {
              this.arguments.push('absoluteReminder');
              this.arguments.push(reminder);
            }
          },

          parseRecurrence: function () {
            var recurrenceDict = this._getParameter('recurrence');
            if (!recurrenceDict) {
              return;
            }

            this.parseRecurrenceInterval(recurrenceDict);
            this.parseRecurrenceFrequency(recurrenceDict);
            this.parseRecurrenceEndDate(recurrenceDict);
            this.parseRecurrenceArrayValue(recurrenceDict, 'daysInWeek');
            this.parseRecurrenceArrayValue(recurrenceDict, 'daysInMonth');
            this.parseRecurrenceArrayValue(recurrenceDict, 'daysInYear');
            this.parseRecurrenceArrayValue(recurrenceDict, 'monthsInYear');
          },

          parseTransparency: function () {
            var validValues = ['opaque', 'transparent'];

            if (this.parameters.hasOwnProperty('transparency')) {
              var transparency = this.parameters.transparency;
              if (contains(transparency, validValues)) {
                this.arguments.push('transparency');
                this.arguments.push(transparency);
              } else {
                this.errors.push('transparency must be opaque or transparent');
              }
            }
          },

          parseRecurrenceArrayValue: function (recurrenceDict, kind) {
            if (recurrenceDict.hasOwnProperty(kind)) {
              var array = recurrenceDict[kind];
              if (!array || !(array instanceof Array)) {
                this.errors.push(kind + ' must be an array.');
              } else {
                var arrayStr = array.join(',');
                this.arguments.push(kind);
                this.arguments.push(arrayStr);
              }
            }
          },

          parseRecurrenceInterval: function (recurrenceDict) {
            if (recurrenceDict.hasOwnProperty('interval')) {
              var interval = recurrenceDict.interval;
              if (!interval) {
                this.errors.push('Recurrence interval cannot be null.');
              } else {
                this.arguments.push('interval');
                this.arguments.push(interval);
              }
            } else {
              // If a recurrence rule was specified without an interval, use a default value of 1.
              this.arguments.push('interval');
              this.arguments.push(1);
            }
          },

          parseRecurrenceFrequency: function (recurrenceDict) {
            if (recurrenceDict.hasOwnProperty('frequency')) {
              var frequency = recurrenceDict.frequency;
              var validFrequencies = ['daily', 'weekly', 'monthly', 'yearly'];
              if (contains(frequency, validFrequencies)) {
                this.arguments.push('frequency');
                this.arguments.push(frequency);
              } else {
                this.errors.push(
                  'Recurrence frequency must be one of: "daily", "weekly", "monthly", "yearly".'
                );
              }
            }
          },

          parseRecurrenceEndDate: function (recurrenceDict) {
            var expires = recurrenceDict.expires;

            if (!expires) {
              return;
            }

            this.arguments.push('expires');
            this.arguments.push(expires);
          },

          _getParameter: function (key) {
            if (this.parameters.hasOwnProperty(key)) {
              return this.parameters[key];
            }

            return null;
          },

          _processStringValue: function (kind) {
            if (this.parameters.hasOwnProperty(kind)) {
              var value = this.parameters[kind];
              this.arguments.push(kind);
              this.arguments.push(value);
            }
          },

          _processDateValue: function (kind) {
            if (this.parameters.hasOwnProperty(kind)) {
              var dateString = this._getParameter(kind);
              this.arguments.push(kind);
              this.arguments.push(dateString);
            }
          },
        };
      })();
    </script>
  </body>
</html>
